import React from 'react';
import { useNavigate } from "react-router-dom";
import './Dashboard.css';

const Dashboard = () => {
    const nav = useNavigate();
    return (
        <div className="container-sm mx-auto mt-5 text-center border border-2 rounded">
            <h1>Dashboard</h1>
            <hr />
            <div className="row text-start">
                <div className="col-sm-4 p-3 dash-nav text-white">

                    <a>Message <span className="badge rounded-pill bg-info">5</span></a>
                    <hr />
                    <a>Sent </a>
                    <hr />
                    <a>Settings </a>
                    <hr />
                    <a>Search: <input id="search-box" type="text" placeholder="Search here" /></a>

                </div>
                <div className="col-sm-8 p-3 bg-dark text-white">
                    <a><span className="badge rounded-pill bg-success">FCS</span></a>
                    <a><span className="badge rounded-pill bg-info">Dal</span></a>
                    <a><span className="badge rounded-pill bg-info">YW</span></a>
                    <a><span className="badge rounded-pill bg-info">TS</span></a>
                    <a><span className="badge rounded-pill bg-info">FCS</span></a>
                </div>
            </div>
            <button className="mt-3 btn btn-primary mb-3"
                onClick={() => {
                    nav("/");
                }}>go to Profile</button>
        </div>
    );
}

export default Dashboard;
